import Navbar from './Components/Navbar';
import about from './Components/about'

function App() {
  return (
  <>
  <div className="container">
      {/*Navigation Bar*/}
        <Navbar title="TextUtils" aboutText = "About"/>
      {/* Text Box */}
      <div className='container my-5'>
        {/* <TextForm heading="Text Analyser"/> */}
      <about/>
      </div>
  </div>
  </>
  );
}
export default App;
